  {
    id: 11,
    fullName: "Adrian Jacobs",
    designation: "Vue Developer",
    gender: "male",
    teamName: "TeamD"
  },
  {
    id: 12,
    fullName: "Devin Monroe",
    designation: "Graphic Designer",
    gender: "male",
    teamName: "TeamD"
  }])

	return (

		<main>
			{
				employees.map(employee => (
					<div>
						<p>{employee.fullName}</p>
						<img src={femaleProfile}/>
					</div>
					
				))
			}
		</main>

	)
}

export default Employees;
